                children: "Era kepemimpinan Presiden Prabowo dimulai pada 20 Oktober 2024, dan di hari yang sama pengumuman Kabinet\nMerah Putih juga dilakukan. Studi ini menganalisis pemilihan menteri di bawah kepemimpinan Prabowo di tengah\nsistem multipartai dan presidensial Indonesia. Menggunakan penelitian kualitatif dari berbagai sumber penelitian,\nlaporan, dan data relevan. Studi ini menemukan bahwa seleksi kabinet di Indonesia tidak bisa lepas dari intervensi politik."
