                children: 'Kabinet "Merah Putih" diumumkan oleh Prabowo Subianto di Istana Merdeka pada 20 Oktober 2024, tepat setelah\ndilantik secara resmi sebagai Presiden periode 2024-2029. Pengumuman dilakukan kepada media yang disertai\nWakil Presiden Gibran Rakabuming Raka dan Ketua Harian Partai Gerindra, Sufmi Dasco Ahmad. Peraturan Presiden\nRepublik Indonesia Nomor 139 Tahun 2024 tentang Penyelenggaraan Tugas dan Fungsi Kementerian Kabinet Merah\nPutih Periode 2024-2029 mengatur komposisi Kabinet Merah Putih yang terdiri dari 53 menteri dan pejabat\nsetingkat menteri, meliputi 7 menteri koordinator; 41 menteri; dan 5 pejabat setingkat menteri, serta 56\nwakil menteri (Sekretariat Kabinet Republik Indonesia, 2024).'
