                children: "Selain itu, dalam pelantikan ini Prabowo mengangkat pejabat setingkat menteri yaitu Jaksa Agung, Kepala dan\nWakil Kepala Kantor Staf Presiden, Kepala Badan Intelijen Negara, Kepala Kantor Komunikasi Presiden, dan\nKetua Dewan Ekonomi Nasional. Komposisi ini menjadikannya struktur kabinet terbesar sejak Orde Baru hingga\nEra Reformasi. Struktur kabinet yang over-size ini tidak mengejutkan bagi publik, sebab pada 14 Oktober 2024\nPrabowo memanggil beberapa tokoh penting ke kediamannya. Pada tanggal tersebut, Sri Mulyani, Agus Harimurti\nYudhoyono, Yusril Ihza Mahendra, Bahlil Lahadalia, dan Muhaimin Iskandar hadir di kediaman Prabowo. Nusron Wahid,\nSaifullah Yusuf, Yandri Susanto, Fadli Zon, Prasetyo Hadi, Natalius Pigai, Maruarar Sirait, Abdul Kadir Karding,\ndan Teuku Riefky Harsya juga muncul memenuhi undangan Prabowo. Total 49 orang menemui Prabowo dari sore hingga\nmalam untuk menandatangani kesediaan menjadi calon menteri pemerintahan Prabowo (BBC, 2024)."
