                children: "Kabinet over-size ini memunculkan berbagai asumsi di kalangan masyarakat. Salah satu kecurigaan atas besarnya\nkabinet ini adalah patronase politik. Dukungan banyak koalisi saat pemilu memunculkan spekulasi bahwa alokasi jabatan\nyang besar telah disiapkan untuk pendukung Prabowo-Gibran sehingga kabinet menjadi lebih besar dibanding\npemerintahan sebelumnya. Tidak hanya ukuran, beberapa nama dalam susunan kabinet juga menarik perhatian. Mungkinkah\npatronase politik, koalisi pendukung yang besar, dan intervensi partai politik menjadi alasan di balik kabinet over-size\nini?"
