                children: "Sistem presidensial dianut pemerintahan Indonesia untuk menciptakan stabilitas dan tingkat demokrasi yang tinggi.\nDalam sistem ini, Presiden sebagai kepala negara sekaligus kepala pemerintahan (single chief executive) menjalankan\nkekuasaan eksekutif dengan dibantu menteri. Presiden memiliki hak prerogatif untuk mengangkat dan memberhentikan\nmenteri yang dipilih untuk menangani bidang pemerintahan tertentu guna mendukung efektivitas pemerintahan dalam\nmelayani kepentingan publik seluas-luasnya. Oleh karena itu, Presiden sebagai pemegang otoritas dalam pengisian\njabatan menteri dan setingkat menteri seharusnya tidak menggunakan logika sistem parlementer yang dibentuk\nberdasarkan koalisi partai politik pendukung Presiden dan Wakil Presiden."
