                children: "Kriteria utama seleksi menteri seharusnya kompetensi bukan balas jasa politik atau kompensasi atas dukungan\npartai politik/golongan terhadap Presiden. Meski secara teoretis dan normatif dianjurkan pengangkatan menteri\ndalam sistem presidensial berdasarkan kompetensi kerja bukan balas jasa politik atau dukungan golongan\nterhadap Presiden, namun praktiknya pengangkatan menteri di Indonesia masih cenderung menggunakan pendekatan\npolitik (Nugraha, 2017). Lebih lanjut, Undang-Undang Nomor 39 Tahun 2008 tentang Kementerian Negara tidak\nmembatasi Presiden untuk mengangkat menteri dari partai politik. Hal ini karena pengangkatan menteri sepenuhnya\nmerupakan hak prerogatif presiden."
