                children: "Namun persoalan muncul ketika menteri dari partai politik diangkat tanpa mempertimbangkan kualitas,\nprofesionalitas, dan integritas calon yang seringkali lebih menekankan aspek patronase politik. Situasi\nini diperparah dengan tidak adanya mekanisme yang jelas untuk mengevaluasi kualitas, profesionalitas, dan\nintegritas calon menteri yang akan diangkat Presiden. Akibatnya, beberapa menteri terlibat kasus korupsi\ndan kinerja beberapa kementerian tidak memenuhi harapan publik (Ansori, 2023)."
