                children: "Beberapa nama dalam Kabinet Merah Putih menarik perhatian publik, sebagian karena dugaan korupsi dan\nlainnya karena kekhawatiran atas keaslian latar belakang pendidikan. Dua orang yang kerap dibahas di\nmedia sosial terkait masalah gelar pendidikan adalah Raffi Ahmad dan Bahlil Lahadalia. Pertama, Raffi Ahmad\nmenerima gelar kehormatan dari Universal Institute of Professional Management (UIPM) di Thailand. Ia\ndianugerahi gelar doktor honoris causa (Dr. HC) dalam Event Management and Global Digital Development.\nSetelah itu, netizen mulai mempertanyakan legitimasi doktor honoris causa Raffi. Lembaga pemberi gelar\ntersebut juga disorot sehingga pemerintah baru-baru ini menolak mengakui gelar doktor honoris causa\nRaffi Ahmad. Di Indonesia, lembaga swasta dan lembaga asing harus mendapatkan persetujuan pemerintah\nuntuk memberikan gelar pendidikan tinggi, sesuai Undang-Undang Nomor 12 Tahun 2012, serta kesesuaian\ndengan Peraturan Menteri Pendidikan dan Kebudayaan Nomor 23 Tahun 2023 tentang lembaga asing."
