                children: "Kedua, gelar doktor Bahlil Lahadalia dari Universitas Indonesia yang diselesaikan dalam waktu kurang dari\ndua tahun juga diragukan. Menurut Andrinof Chaniago, dosen Fakultas Ilmu Sosial dan Ilmu Politik Universitas\nIndonesia, mustahil menyelesaikan program doktor dalam dua tahun meskipun melalui jalur riset. Membaca dan\nmenganalisis untuk menyusun tinjauan literatur kritis saja biasanya memakan waktu sekitar satu tahun, belum termasuk\nwaktu untuk penyusunan draf, penelitian lapangan, dan masukan dari pembimbing. Selain itu, ada kecurigaan bahwa\nkarya Bahlil Lahadalia diterbitkan di jurnal predator yang dikenal tidak memenuhi standar akademik. Publikasi di\njurnal predator berpotensi menimbulkan masalah etika dan merusak reputasi Universitas Indonesia. Dewan Profesor\nUniversitas Indonesia merespons dengan mengadakan rapat pada 18 Oktober 2024 untuk membahas gelar doktor\nyang diberikan Sekolah Kajian Stratejik dan Global (SKSG) kepada Menteri Energi dan Sumber Daya Mineral\nBahlil Lahadalia (Lavenia & Yanuar, 2024)."
