                children: "Indonesia Corruption Watch (ICW) merespons pengangkatan nama-nama yang dianggap bermasalah dalam\npemerintahan Presiden Prabowo melalui pernyataan pers. ICW mencatat setidaknya enam masalah utama dalam\npembentukan Kabinet Merah Putih yang terbesar sejak Orde Baru hingga Era Reformasi ini. Pertama, alasan utama\npembentukan kabinet sebesar ini tidak jelas, tidak ada data atau analisis yang mendukung kebutuhan sejumlah\nbesar pejabat pemerintah dalam Kabinet Merah Putih yang berpotensi berdampak pada birokrasi dan anggaran.\nKedua, pemilihan menteri dan wakil menteri mengabaikan integritas dan catatan hukum, terutama terkait dugaan\nkorupsi."
