                children: "Kabinet zaken adalah istilah yang diberikan untuk kabinet yang diisi oleh profesional dan ahli di bidangnya.\nKabinet ini dipilih berdasarkan kompetensi bukan afiliasi politik atau kepentingan partai, bertujuan\nmengatasi tantangan politik melalui kolaborasi yang berakar pada keahlian dan kompetensi,\nbukan hubungan politik (Ismail & Setiawan, 2022). Setelah kemerdekaan, beberapa kabinet presidensial\nIndonesia dikenal sebagai kabinet zaken. Tiga kabinet zaken yang sering disebut adalah Kabinet\nNatsir 1950, Kabinet Wilopo 1952-1953, dan Kabinet Djuanda 1957. Kabinet-kabinet ini disusun dengan\nmempertimbangkan komposisi, artinya lebih sedikit mengandalkan dukungan partai dan parlemen tetapi\nlebih pada individu dengan kapasitas setara yang bisa bekerja sama dengan baik. Namun, kabinet yang\ndiisi profesional dan ahli pun tidak sepenuhnya bebas dari kepentingan politik. Komposisi kabinet\nbisa disebut zaken ketika sekitar 60%-70% terdiri dari profesional dan ahli, sisanya berasal dari politisi (Aman, 2013)."
