                children: "Hukum konstitusi memberikan wewenang kepada presiden untuk memilih menteri bagi kabinetnya, namun membentuk\nkabinet jauh dari sederhana. Pembentukan kabinet di Indonesia sering dikaburkan oleh isu politik karena\ntumpang tindih antara sistem multipartai yang berlaku dan sistem presidensial yang digunakan di Indonesia.\nKombinasi sistem multipartai dan presidensial ini menjadi salah satu alasan politik transaksional dalam\npengangkatan menteri, dan juga menghambat pembentukan pemerintahan yang efektif dan stabil (Lestari, 2022).\nHal ini sebagian karena, di bawah sistem presidensial-multipartai, presiden terpilih mungkin tidak didukung\noleh mayoritas parlemen. Selain itu, presiden dari partai minoritas di parlemen menghadapi tantangan dalam\nnegosiasi politik dengan parlemen. Masalah lain termasuk koalisi yang tidak permanen dan tidak mengikat serta\nkonflik kepentingan, terutama ketika menteri dari partai politik memegang posisi ganda (Ansori, 2023)."
